// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./TokenContract.sol";
pragma solidity ^0.8.0;

contract UserRequestStruct {
    enum RequestStatus { Pending, VouchingProcess, CommunityValidation, Closed }

    TokenContract public tokenContract = TokenContract(0x406AB5033423Dcb6391Ac9eEEad73294FA82Cfbc);

    struct UserRequest {
        address user;
        address[] vouched;
        uint256 vouchedCount;
        string skill;
        string project;
        string experience;
        uint256 stakeAmountByUser;
        RequestStatus status;
        uint256 creationTime;
    }

    mapping(uint256 => UserRequest) public userRequests;
    uint256 public nextRequestId;

    event RequestAdded(uint256 indexed requestId, address indexed user, string skill, string project, string experience, uint256 stakeAmount, RequestStatus status);

    constructor() {
        nextRequestId = 1;
    }

    function add(
        address _user,
        address[] memory _vouched,
        uint256 _vouchedCount,
        string memory _skill,
        string memory _project,
        string memory _experience,
        uint256 _stakeAmountByUser,
        uint256 _creationTime
    ) external returns (uint256 requestId) {
        requestId = nextRequestId;
        userRequests[requestId] = UserRequest({
            user: _user,
            vouched: _vouched,
            vouchedCount: _vouchedCount,
            skill: _skill,
            project: _project,
            experience: _experience,
            stakeAmountByUser: _stakeAmountByUser,
            status: RequestStatus.VouchingProcess,
            creationTime: _creationTime
        });
        nextRequestId++;

        emit RequestAdded(requestId, _user, _skill, _project, _experience, _stakeAmountByUser, RequestStatus.VouchingProcess);
    }


    function get(uint256 requestId) external view returns (UserRequest memory) {
        return userRequests[requestId];
    }

    function addVoucher(uint256 _requestId, address voucher) external {
        userRequests[_requestId].vouched.push(voucher);
        userRequests[_requestId].vouchedCount++;
    }
}

